                                                                    "name": "Order Summary",
                                                                    "value": " <table cellspacing=\"10\" width=\"100%\" style=\" padding:0px 10px 0px 0px; color: {{marketing.colour4}};\" id=\"templateColumns\">\n                    {{#each order.orderLines}}\n                      <tr>\n                        <td align=\"center\" valign=\"top\" width=\"10%\" style=\" padding:0px 0px 0px 20px;\">\n                          <div style=\"background-image: url({{imageUrl}}); background-repeat: no-repeat; background-position: top center; background-size: cover; padding-top: 100%; width: 150px;  margin-bottom: 10px;\" id=\"product-image\"></div>\n                        </td>\n                        <td align=\"left\" valign=\"top\" width=\"80%\">\n                          <p style=\"font-size:14px; font-weight:600\">{{name}}</p>\n                          {{#if discount.amount}}\n                            <p style=\"font-size:12px; font-weight:400\">(-{{discount.currency}}{{discount.amount}})</p>\n                          {{/if}}\n                          {{#if discount.percentage}}\n                            <p style=\"font-size:12px; font-weight:400\">(-{{discount.percentage}})</p>\n                          {{/if}}\n                        </td>\n                        <td align=\"right\" valign=\"top\" width=\"10%\" id=\"product-currency\">\n                          <p style=\"font-size:14px; font-weight:600\">{{../templateText.quantity}}</p>\n                          <p align=\"center\" style=\"font-size:12px; font-weight:400\">{{quantity}}</p>\n                        </td>\n\n                        <td align=\"right\" valign=\"top\" width=\"10%\" id=\"product-currency\">\n                          <p style=\"font-size:14px; font-weight:600\">{{../templateText.priceTotal}}</p>\n                          {{#if discount}}\n                            <s><p align=\"center\" style=\"font-size:10px; font-weight:400\">{{price.currency}}{{price.amount}}</p></s>\n                          {{/if}}\n                          <p align=\"center\" style=\"font-size:12px; font-weight:400\">{{total.currency}}{{total.amount}}</p>\n                        </td>\n                      </tr>\n                    {{/each}}\n                  </table>"
