                                                            "name": "Product Recommendations",
                                                            "value": "{{#if campaign.productRecommendationsEnabled}}\n  <div style=\"padding: 0px 0px; color: {{trackingPageConfiguration.colour4}};\">\n    {{#if (greaterThan campaign.productRecommendations.length 0)}}\n      <table border=\"0\"  cellspacing=\"0\" align=\"center\" width=\"100%\" style=\"max-height: 400px;\">\n        <tr>\n          <td width=\"50%\">\n            <p style=\"font-size:18px; font-family:inherit;font-weight: 700; text-transform:uppercase;\">{{templateText.productRecommendation}}</p>\n          </td>\n        </tr>\n      </table>\n    {{/if}}\n    <table align=\"center\" width=\"100%\" style=\"padding: 0px 20px 0px 20px\">\n      <tr>\n        {{#each campaign.productRecommendations}}\n          <td width=\"30%\" style=\"max-height:400px; vertical-align:top;\" align=\"center\">\n            {{#if name}}\n              <div style=\"height: 100%; max-width:180px;\">\n                <a href={{hyperlink}} style=\"align-text: center; \">\n\n                  <div style=\"background-image: url({{imageUrl}}); background-repeat: no-repeat; background-position-x: center; background-position-y: center; background-size: contain; padding-top: 100%; width: 100%; margin: auto; margin-bottom: 10px;\">\n                  </div>\n                </a>\n                <p style=\"font-size:14px; font-weight:600; margin:1px\" align=\"left\">\n                  {{name}}\n                </p>\n\n              </div>\n            {{/if}}\n          </td>\n        {{/each}}\n      </tr>\n      <tr>\n        {{#each campaign.productRecommendations}}\n          <td width=\"30%\" style=\"max-height:400px; vertical-align:top;\" align=\"center\">\n            {{#if name}}\n              <div style=\"height: 100%; max-width:180px;\">\n                <p style=\"font-size:14px; font-weight: 400;line-height: 24px; margin:1px;\" align=\"left\">\n                  {{price.currency}} {{price.amount}}\n                </p>\n              </div>\n            {{/if}}\n          </td>\n        {{/each}}\n      </tr>\n    </table>\n  </div>\n{{/if}}"
